exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://www.hhlwx.com/hhlchapter/${bid}.html`,{cleaner:html=>cleanCatalogWrapper(html,/<table[^>]*>\s*<td [^>]*class="chapterlist/,"</table>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};